/** * @brief Executes the internal ADC read command, containing the temperature or pressure raw data. * it is expected to receive 24 bits from the IC, so it must be casted onto an uint32_t. * @note First it a conversion command must be executed in order to receive data. * @retval uint32_t with raw measurement value. */
static uint32_t MS5611_ADC_READ(); /** * @brief Executes pressure conversion sequence (D1). * @param ConversionCommandD1 pressure conversion command, it defines the ADC's internal sample rate * @note The higher the sample rate, the longer it takes for the sensor to return raw data. */
static void MS5611_Conversion_D1(ConversionCommandD1 command); /** * @brief Executes temperature conversion sequence (D2). * @param ConversionCommandD2 temperature conversion command, it defines the ADC's internal sample rate * @note The higher the sample rate, the longer it takes for the sensor to return raw data. */
