/** * @brief Calculates temperature difference from the prom value, and the raw temperature. * @param PROM_Data pointer to a populated struct with data from the prom. * @param D2_value(temperature) raw value of the temperature, extracted from the conversion sequence. * @retval int32_t */
static int32_t calculate_temp_diff(PROM_Data * prom_data, uint32_t D2_value ); /** * @brief Calculates actual temperature using data extracted from the prom, * uses the raw temperature, to calculate the temperature difference according to the datasheet. * @param PROM_Data pointer to a populated struct with data from the prom. * @param D2_value(temperature) raw value of the temperature, extracted from the conversion sequence. * @retval int32_t */
static int32_t calculate_temperature(PROM_Data * prom_data, uint32_t D2_value); /** * @brief Calculates the temperature in fahrenheit units given the temperature in celsius. * @param temp_celsius temperature value obtained from the sensor. * @retval int32_t converted temperature. */
static int32_t celsiusToFahrenheit(int32_t temp_celsius);
/** * @brief Calculates actual pressure using data extracted from the prom, * uses the raw temperature, to calculate the temperature difference according to the datasheet. * @param PROM_Data pointer to a populated struct with data from the prom. * @param D1_value(pressure) raw value of the temperature, extracted from the conversion sequence. * @param D2_value(temperature) raw value of the temperature, extracted from the conversion sequence. * @retval int32_t */
static int32_t calculate_pressure(PROM_Data * prom_data,uint32_t D1_value , uint32_t D2_value );
/** * @brief Calculates the altitude given the pressure. * @param pressure value obtained from the sensor. * @note formula obtained from https://www.weather.gov/media/epz/wxcalc/pressureAltitude.pdf * @retval int32_t */
static int32_t calculateAltitude(int32_t pressure);

